import React from "react";
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import watch from "../src/image/images (3).jpg";
import watch1 from "../src/image/15be33d514f99d4cb6bc453e405cbb6d.jpg";
import watch2 from "../src/image/images (1).jpg";
import watch3 from "../src/image/images (2).jpg";
import watch4 from "../src/image/images.jpg";
import watch5 from "../src/image/unnamed.webp";

const Carasoule=()=>{
    var settings = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 1,
        slidesToScroll: 1,
      };
    return(
        <>
 <div className="container-fluid">
                <div className="row">
                    <div className="col-lg-12">
                    <Slider {...settings}>
                <div><img src={watch} style={{width:'100%'}} alt="Responsive image"/></div>
                <div><img src={watch1} className="max-width: 100% height:auto img-responsive" alt="Responsive image"/></div>
                <div><img src={watch2} className="max-width: 100% height:auto img-responsive" alt="Responsive image"/></div>
                <div><img src={watch3} className="max-width: 100% height:auto img-responsive" alt="Responsive image"/></div>
                <div><img src={watch4} className="max-width: 100% height:auto img-responsive" alt="Responsive image"/></div>
                <div><img src={watch5} className="max-width: 100% height:auto img-responsive" alt="Responsive image"/></div>
                
            </Slider>
                    </div>
                </div>
            </div>
        </>
    );
}

export default Carasoule;
